window.bookSummaryJSON = "<p><b>Late in the 21st century, Earth receives what looks like an urgent plea for help from planet Proxima Centauri b in the closest star system to the Sun.</b></p> <p>Astrophysicists suspect a massive solar flare is about to destroy this heretofore-unknown civilization. Earth's space programs are unequipped to help, but an unscrupulous Russian billionaire launches a secret and highly-specialized spaceship to Proxima b, over four light-years away.</p> <p>The unusual crew faces a Herculean task - should they survive the journey. No one knows what to expect from this alien planet.</p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
